import React from 'react'
import ServiceCard from './ServiceCard'
import {Col} from "reactstrap"

import weatherImg from '../assets/images/weather.png'
import guideImg from '../assets/images/g'
import custumizationImg from '../assets/images/customization.png'

const servicesData=[
    {
        imgUrl: weatherImg,
        title :"Calculate Weather",
        desc: "Lorem ipsum dolor sit, amet consectetur adipisicing elit."
    },
    {
        imgUrl: guideImg,
        title :"Best Tour Guide",
        desc: "Lorem ipsum dolor sit, amet consectetur adipisicing elit."
    },
    {
        imgUrl: custumizationImg,
        title :"Customization",
        desc: "Lorem ipsum dolor sit, amet consectetur adipisicing elit."
    },
]
const ServiceList = () => {
  return (
    <>{
        servicesData.map((item,index)=><Col lg='3' key={index}><ServiceCard item={item} ></ServiceCard></Col> )
    }
    </>
  )
}

export default ServiceList
